import { useState } from "react/cjs/react.production.min";
import Logs from "./Components/Log/Logs";
import LogsForm from "./Components/LogForm/LogsForm";
const App = () => {
  const data = useState;
  return (
    <div>
      <LogsForm />
      <Logs logsData={data}/>
    </div>
  );
};
export default App;
